import ReactDOM from "react-dom";
import * as serviceWorker from "./NotificationsFolder/serviceWorker";
import NotificationProvider from "./NotificationsFolder/Notifications/NotificationProvider";

import App from "./App";
import { BrowserRouter } from "react-router-dom";
import React from "react";

ReactDOM.render(
  <React.StrictMode>
    <NotificationProvider>
      <App></App>
    </NotificationProvider>
  </React.StrictMode>,
  document.getElementById("root")
);
